import AppBar from "@material-ui/core/AppBar"
import Toolbar from "@material-ui/core/Toolbar"

const styles = {
  root: {
    flexGrow: 1,
  },
  grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginLeft: -12,
    marginRight: 20,
  },
}

const Navbar = (props) => {
  const { classes } = props
  return (
    <div className="{classes.root}">
      <AppBar>
        <Toolbar>
          <a href="#">Hey</a>
        </Toolbar>
      </AppBar>
    </div>
  )
}

Navbar.prototype

export default Navbar
